import React, { Fragment } from "react";
import Header from '../Header'
import Intro from './Intro'
import TimerSection from "./TimerSection";
import Timer from "./Timer";

const PomodoroPage = props =>{

    return(
        <Fragment>
        <Header/>
        <Intro/>
       <TimerSection/> 
       <Timer/>
        </Fragment>
    );
}

export default PomodoroPage;
